import React , {useState ,useContext , useEffect} from 'react'
import { Context } from '../context'
import { Link } from 'react-router-dom'
import useDelayedState from 'use-delayed-state'
import  YouTube from 'react-youtube'
import '../style/topRatedSlide.css'
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

export default function TopRatedSlideProva(){
    const {wishMovie , addToCart , removeToCart , CartMovie , addTowishMovie , removeTowishMovie , topRatedMovie} = useContext(Context)
    const [hover , setHover] = useDelayedState(false)
    const [hoverOne , setHoverOne] = useDelayedState(false)
    const [hoverVideo ,setHoverVideo] = useDelayedState(false)
    const [ getVideo , setGetVideo] = useState('')
    useEffect(()=>{
        fetch(`https://api.themoviedb.org/3/${topRatedMovie.movie}/${topRatedMovie.id}/videos?api_key=efc42faadb8a20858df7818520bb9d80&language=en-US&name&append_to_response=videos`)
        .then(response => response.json())
        .then(data=> setGetVideo(data.results[0]))
      },[topRatedMovie.id])
    function hoverTrueOne(){
        setHoverOne(true , 300 ) 
        // setHoverVideo(true,1000 )  
        // topRatedMovie.hoverTrue()      
      }
    function hoverTrue(){
        setHover(true , 300 ) 
        setHoverVideo(true,1000 )  
        // topRatedMovie.hoverTrue()      
      }
      function hoverFalseOne(){
         setHoverOne(false , -300 )
         setHoverVideo(false ,-1000 )
        //  topRatedMovie.hoverFalse()
        }
      function hoverFalse(){
         setHover(false , -300 )
         setHoverVideo(false ,-1000 )
        //  topRatedMovie.hoverFalse()
        }
    function cart(){
        const isAdded = CartMovie.find(movie => movie.id === topRatedMovie.id)
        if(isAdded){
            return (<div className='list-shopping'>
                   <i className="ri-shopping-bag-fill topRated-unrent-icon"
                     onClick={()=>removeToCart(topRatedMovie.itemCart.id)} >
                    </i>
                   </div>)
        }else {
            return ( <div className='list-shopping'> 
                   <i className="ri-shopping-bag-line topRated-unrent-icon"
                    onClick={()=>addToCart(topRatedMovie.itemCart)}>
                    </i>
          </div>)
        }
    }
    function heart(){
        const isAdded = wishMovie.find(movie => movie.id === topRatedMovie.id)
        if(isAdded){
            return (<div className='top-shopping'>
                    <i className="ri-heart-fill heart-topRated" 
                     onClick={()=>removeTowishMovie(topRatedMovie.itemCart.id)}>
                     </i>
                     </div>
                     )
                           }else {
                            return (<div className='top-shopping'>
                            <i className="ri-heart-line heart-topRated" 
                             onClick={()=>addTowishMovie(topRatedMovie.itemCart)}>
                             </i>
                            </div>
                             )
                           }
                        }
                        // adult
                        // : 
                        // false
                        // backdrop_path
                        // : 
                        // "/tmU7GeKVybMWFButWEGl2M4GeiP.jpg"
                        // genre_ids
                        // : 
                        // (2) [18, 80]
                        // id
                        // : 
                        // 238
                        // ids
                        // : 
                        // "150"
                        // movie
                        // : 
                        // "Movie"
                        // name
                        // : 
                        // "Top Rated"
                        // original_language
                        // : 
                        // "en"
                        // original_title
                        // : 
                        // "The Godfather"
                        // overview
                        // : 
                        // "Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge."
                        // popularity
                        // : 
                        // 113.417
                        // poster_path
                        // : 
                        // "/3bhkrj58Vtu7enYsRolD1fZdja1.jpg"
                        // release_date
                        // : 
                        // "1972-03-14"
                        // title
                        // : 
                        // "The Godfather"
                        // type
                        // : 
                        // "TopRated"
                        // video
                        // : 
                        // false
                        // vote_average
                        // : 
                        // 8.7
                        // vote_count
                        // : 
                        // 17826  
                        const settingsTopRated = {      
                            pauseOnHover: true,
                             dots: false,
                             infinite: true,
                             speed: 500,
                             centerMode:true,
                             slidesToShow: 5,
                             slidesToScroll: 1,
                             autoplay: false,
                             autoplaySpeed: 6500,
                             prevArrow: <CustomPrevArrowTopRated  />,
                             nextArrow: <CustomNextArrowTopRated  />
                           } 
                        const settingsTopRatedOne = {      
                            pauseOnHover: true,
                             dots: false,
                             infinite: true,
                             speed: 500,
                             centerMode:false,
                             slidesToShow: 4,
                             slidesToScroll: 1,
                             autoplay: false,
                             autoplaySpeed: 6500,
                             prevArrow: <CustomPrevArrowTopRated  />,
                             nextArrow: <CustomNextArrowTopRated  />
                           } 
                           function CustomNextArrowTopRated(topRatedMovie) {
                            const { onClick } = topRatedMovie;
                            return (
                              <button className="next-topRated" style={{heigth:'100px'}} onClick={onClick} >
                                <i className="ri-arrow-right-s-line"></i>
                              </button>
                            );
                          }
                          function CustomPrevArrowTopRated(topRatedMovie) {
                            const { onClick } = topRatedMovie;
                            return (
                              <button className="prev-topRated" onClick={onClick}>
                                <i className="ri-arrow-left-s-line"></i>
                              </button>
                            );
                          }           
    return(
        <>
       {hoverOne === false? <Slider {...settingsTopRated}>
        
        <div className='topRated-slide-big' onMouseEnter={()=>hoverTrueOne()}  onMouseLeave={()=>hoverFalseOne()}>           
           {hoverOne ? <div className='topRated-list-ctn'  onMouseLeave={()=>hoverFalseOne()}>        
                 <div className='list-overview-topRated' onMouseLeave={()=>hoverFalseOne()}> 
                   {hoverVideo ?<YouTube className={hover ? 'youtube-trailer-topRated margin-videos' :"youtube-trailer-topRated"}  videoId={`${getVideo.key}`} autoPlay={true} /> 
                     : <img src={`https://image.tmdb.org/t/p/original/${topRatedMovie[0].backdrop_path}`} alt={topRatedMovie[0].original_title}  />}
                 <div className='list-padding-ctn-topRated' >
                  <div className='list-title-flex-topRated'>
                   <h1 className='list-title-topRated'>{topRatedMovie[0].original_title}</h1>
                  <div className='list-icon-ctn-topRated'>
                     {cart()}
                     {heart()}
                   <div className='list-shopping'>
                    <Link to={`/${topRatedMovie[0].movie}/${topRatedMovie[0].id}`} state={'Home'}>
                      <i className="ri-spy-line spy-topRated "></i>
                    </Link>
                   </div>
                  </div>
                 </div>                                 
                 </div>
                 </div>
             </div> : 
                <div className={hover? 'img-topRated-ctn margin-video' :'img-topRated-ctn'} >
                <img src={`https://image.tmdb.org/t/p/original/${topRatedMovie[0].poster_path}`} alt={topRatedMovie[0].original_title}   />
               </div>
               }
            
        </div>
        <div className='topRated-slide-big' onMouseEnter={()=>hoverTrue()}  onMouseLeave={()=>hoverFalse()}>           
           {hover ? <div className='topRated-list-ctn'  onMouseLeave={()=>hoverFalse()}>        
                 <div className='list-overview-topRated' onMouseLeave={()=>hoverFalse()}> 
                   {hoverVideo ?<YouTube className={hover ? 'youtube-trailer-topRated margin-videos' :"youtube-trailer-topRated"}  videoId={`${getVideo.key}`} autoPlay={true} /> 
                     : <img src={`https://image.tmdb.org/t/p/original/${topRatedMovie[1].backdrop_path}`} alt={topRatedMovie[1].original_title}  />}
                 <div className='list-padding-ctn-topRated' >
                  <div className='list-title-flex-topRated'>
                   <h1 className='list-title-topRated'>{topRatedMovie[1].original_title}</h1>
                  <div className='list-icon-ctn-topRated'>
                     {cart()}
                     {heart()}
                   <div className='list-shopping'>
                    <Link to={`/${topRatedMovie[1].movie}/${topRatedMovie[1].id}`} state={'Home'}>
                      <i className="ri-spy-line spy-topRated "></i>
                    </Link>
                   </div>
                  </div>
                 </div>                                 
                 </div>
                 </div>
             </div> : 
                <div className={hover? 'img-topRated-ctn margin-video' :'img-topRated-ctn'} >
                <img src={`https://image.tmdb.org/t/p/original/${topRatedMovie[1].poster_path}`} alt={topRatedMovie[1].original_title}   />
               </div>
               }
            
        </div>
        <div className='topRated-slide-big' onMouseEnter={()=>hoverTrue()}  onMouseLeave={()=>hoverFalse()}>           
           {hover ? <div className='topRated-list-ctn'  onMouseLeave={()=>hoverFalse()}>        
                 <div className='list-overview-topRated' onMouseLeave={()=>hoverFalse()}> 
                   {hoverVideo ?<YouTube className={hover ? 'youtube-trailer-topRated margin-videos' :"youtube-trailer-topRated"}  videoId={`${getVideo.key}`} autoPlay={true} /> 
                     : <img src={`https://image.tmdb.org/t/p/original/${topRatedMovie[1].backdrop_path}`} alt={topRatedMovie[1].original_title}  />}
                 <div className='list-padding-ctn-topRated' >
                  <div className='list-title-flex-topRated'>
                   <h1 className='list-title-topRated'>{topRatedMovie[1].original_title}</h1>
                  <div className='list-icon-ctn-topRated'>
                     {cart()}
                     {heart()}
                   <div className='list-shopping'>
                    <Link to={`/${topRatedMovie[1].movie}/${topRatedMovie[1].id}`} state={'Home'}>
                      <i className="ri-spy-line spy-topRated "></i>
                    </Link>
                   </div>
                  </div>
                 </div>                                 
                 </div>
                 </div>
             </div> : 
                <div className={hover? 'img-topRated-ctn margin-video' :'img-topRated-ctn'} >
                <img src={`https://image.tmdb.org/t/p/original/${topRatedMovie[1].poster_path}`} alt={topRatedMovie[1].original_title}   />
               </div>
               }
            
        </div>
        <div className='topRated-slide-big' onMouseEnter={()=>hoverTrue()}  onMouseLeave={()=>hoverFalse()}>           
           {hover ? <div className='topRated-list-ctn'  onMouseLeave={()=>hoverFalse()}>        
